css:
@-moz-document domain("dumpert.nl") {
body {
    background-image: url("https://i.imgur.com/Bdn6FEv.png")
}

body .dump-main, .dump-ftr {
    background: rgba(255,255,255,.3);
    color: #fff;
}

a.dumpthumb, #playerarea, #iteminfo, #fancyupload, #sendafriend, #embedcode, .dump-cnt>article, .dump-rate .dump-kudos, .dump-rate .dump-views>div, .dump-rate .dump-reactions>div {
    background: rgba(255,255,255,.3);
}

a.dumpthumb .details h1 {
    color: #fff;
}
a.dumpthumb .details , a.dumpthumb .details date, a.dumpthumb .details .stats, .dump-pub {
    color: #ddd;
}

a.dumpthumb .details .description {
    color: #eee;
}
}
